import { Route } from "react-router-dom";
import ImagePage from "./components/Landing";
// import Dashboard from "./DashboardV6";

function ProtectedRoute(props) {
    var isUserLoggedIn=window.sessionStorage.getItem("isAdminLoggedIn");
    isUserLoggedIn=true
    if(isUserLoggedIn)
    {

        return <Route exact path={props.path} element={props.component}></Route>
    }else{
        return <ImagePage/>
    }



}

export default ProtectedRoute;
